-- PostgreSQL Archive Table --
CREATE TABLE IF NOT EXISTS twitter_archive (
    tweet_id BIGINT PRIMARY KEY,
    timestamp TIMESTAMP,
    source TEXT,
    tweet_text TEXT,
    rating_numerator INT,
    rating_denominator INT,
    dog_stage VARCHAR(50)
);



